import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="grid">
        <header className="header">
            <img className="header_img" src="./file.png" alt="logo"></img>
        </header>
        <nav className="sidebar">
            <div>Profile</div>
            <div>Message</div>
            <div>News</div>
            <div>Music</div>
            <div>Settings</div>
        </nav>
        <div className="content">Content</div>
    </div>
  );
}

export default App;
